USE stock_exchange;












-- устранение логических несоответствий в базе данных

SELECT COUNT(*) FROM brokers WHERE created_at > updated_at;
UPDATE brokers SET updated_at = NOW() WHERE created_at > updated_at;

SELECT COUNT(*) FROM clients WHERE created_at > updated_at;
UPDATE clients SET updated_at = NOW() WHERE created_at > updated_at;

SELECT COUNT(*) FROM issuers WHERE created_at > updated_at;
UPDATE issuers SET updated_at = NOW() WHERE created_at > updated_at;

SELECT COUNT(*) FROM profiles WHERE created_at > updated_at;
UPDATE profiles SET updated_at = NOW() WHERE created_at > updated_at;

SELECT COUNT(*) FROM shares WHERE created_at > updated_at;
UPDATE shares SET updated_at = NOW() WHERE created_at > updated_at;


SELECT * FROM transactions ORDER BY quantity DESC ;

UPDATE transactions SET quantity = FLOOR(10 + RAND() * 9900); 

SELECT * FROM shares ORDER BY shares_outstanding DESC;

UPDATE shares SET shares_outstanding = FLOOR(1000 + RAND() * 990000); 


